INSERT INTO `law_content` (`id`, `kind`, `title`, `summary`, `body`, `image_path`, `doc_path`, `external_link`, `author_admin_id`, `published_at`, `created_at`, `updated_at`) VALUES
(1, 'document', 'Probate law, revocation of wills, and evidentiary standards under Sri Lankan law.', 'The Supreme Court judgment in SC Appeal No. 38/2014 is a significant decision dealing with probate law, revocation of wills, and evidentiary standards under Sri Lankan law.', '• Forgery claim was not proved by the Respondents.\r\n• The Last Will was properly attested and executed, as evidenced by the notary and attesting witnesses.\r\n• Failure to produce the original will did not invalidate the application; probate can be granted based on a protocol or certified copy (as per Weerasinghe v Nagahawatte [1984] 1 SLR 420).\r\n• The presumption of revocation was not applicable, given the specific violent and chaotic circumstances surrounding the testator’s death.\r\n• The Court of Appeal erred in disregarding both the proper evidentiary standard and the legal consequences of the second marriage’s invalidity.', 'uploads/images/5b4381fe65af4733bc6100eedc714911_istockphoto-1388548812-612x612.jpg', 'uploads/docs/57eaaca2869d4513b193598b7c9e8848_BSc_in_SE_-_Batch_29_-_CIS_6005_Computational_Intelligence_viva_-_23rd_AGU_2025.pdf', 'https://lankalaw.net/2025/07/11/probate-law-revocation-of-wills-and-evidentiary-standards-under-sri-lankan-law/', 7, '2025-09-04 19:02:18', '2025-08-24 06:50:58', '2025-09-04 13:32:18'),
(2, 'news', 'Sri Lanka Electricity (Amendment) Act, No. 14 of 2025', 'The Sri Lanka Electricity (Amendment) Act, No. 14 of 2025, certified on 18th August 2025, introduces significant reforms to the Sri Lanka Electricity Act, No. 36 of 2024.', 'The Sri Lanka Electricity (Amendment) Act, No. 14 of 2025, certified on 18th August 2025, introduces significant reforms to the Sri Lanka Electricity Act, No. 36 of 2024. This legislation addresses structural reforms in the power sector, enhances regulatory clarity, and aligns the electricity industry with national energy policy, renewable energy commitments, and international best practices.', 'uploads/images/e0e728a95ff64efc9e48aba18b5585d6_Legal_Managed_Services.jpg', NULL, 'https://lankalaw.net/2025/08/28/sri-lanka-electricity-amendment-act-no-14-of-2025/', 7, '2025-09-04 19:00:22', '2025-09-01 13:32:02', '2025-09-04 13:30:22');

